import React from 'react';
import '../../App.css';
import './Exams.css';
import Autocomplete from '@material-ui/lab/Autocomplete';

export default function Exams() {


  return (
    <div className='content'>
      <div className='fillter-option'>
        <select>
          <option>Lớp 1</option>
          <option>Lớp 2</option>
        </select>

        <select>
          <option>Môn Hoá</option>
          <option>Môn Toán</option>
        </select>

        <select>
          <option>Lớp 1</option>
          <option>Lớp 2</option>
        </select>

        <select>
          <option>Lớp 1</option>
          <option>Lớp 2</option>
        </select>
 

        <Autocomplete
        options={options}
        style={{ width: 300 }}
        renderInput={(params) =>
          <TextField {...params} label="Combo box" variant="outlined" />}
      />
      </div>
    </div>
  );
}
